var input = "\n" +
            "\n" +
            "\n" +
            "\n" +
            "",
    codes = input.split('\n'),
    UPPER_BOUNDS = 9,
    LOWER_BOUNDS = 1,
    START_POS = 5,
    curPos = START_POS,
    move,
    result = '';

/* Example
codes = ("ULL\n" +
        "RRDDD\n" +
        "LURDL\n" +
        "UUUUD").split('\n');
*/

for(code in codes){
    code = codes[code];
    for(var i=0, l=code.length; i<l; i++){
        move = code.charAt(i);

        switch(move){
            case 'U':
                if(curPos-3 >= 1) curPos -= 3;
                break;
            case 'D':
                if(curPos+3 <=9) curPos += 3;
                break;
            case 'L':
                if(curPos != 1 && curPos != 4 && curPos != 7){
                    curPos--;
                }
                break;
            case 'R':
                if(curPos != 3 && curPos != 6 && curPos != 9){
                    curPos++;
                }
                break;
            default:
                throw new Error('Weird input! \'' + move + '\'');
        }
    }
    result = result + curPos;
}
console.log(result);

